import React from 'react';
import NotificationCount from '../NotificationCount';
import styles from './NavItem.module.css';

export default function NavItem(props) {
    return (
        <div className={styles.nav_item}>
            <div className="icon">
                {props.children}
            </div>
            <div className="text"></div>
            <NotificationCount/>
        </div>
    )
}
